(7723271, '河北', '本科批', '物理', '化', '0145', '45', '北京联合大学', '01', '人工智能', '(京津冀职教改革项目)(京津冀职教改革项目)(京津冀职教改革项目)京津冀职教改革项目是经北京市教育委员会、天津市教育委员会、河北省教育厅批复，依托北京经济管理职业学院联合北京联合大学等四所北京市属高校共同建设，开展本科层次合作办学，充分发挥本科院校的学科优势、师资优势和高职院校的职业实训资源优势、行业企业资源优势等，为京津冀协同发展培养高层次技术技能人才。该项目录取的考生在校期间培养地点均设置在北京经济管理职业学院固安校区，执行京津冀职业教育改革示范园区的相关管理规定', 2024, 0, 0),
