(7724431, '河北', '本科批', '物理', '化', '0399', '99', '大连理工大学', '15', '数学类', '(数学类及华罗庚拔尖计划班)含数学与应用数学、信息与计算科学专业；本专业类内分流任选。入校后选拔进入华罗庚（拔尖计划班），该班型高保研率培养。入选教育部“101计划”。数学类专业2024年与英国爱丁堡大学、曼彻斯特大学、布里斯托大学、卡迪夫大学有联合培养项目', 2024, 0, 0),
(7724432, '河北', '本科批', '物理', '化', '0399', '99', '大连理工大学', '16', '工程力学', '(创新班)高保研率培养。学生入校后有机会选拔进工程力学（拔尖计划班）', 2024, 0, 0),
(7724433, '河北', '本科批', '物理', '化', '0399', '99', '大连理工大学', '17', '智能制造工程', '(创新班)高保研率培养。含智能制造工程、车辆工程（英语强化）、测控技术与仪器、机械设计制造及其自动化。学生入校后有机会选拔进工程力学（拔尖计划班）。机械工程等专业2024年与美国加州大学欧文分校、美国伊利诺伊大学芝加哥分校有联合培养项目', 2024, 0, 0),
(7724434, '河北', '本科批', '物理', '化', '0399', '99', '大连理工大学', '18', '智能制造工程', '含机械设计制造及其自动化、智能制造工程、车辆工程（英语强化）、能源与动力工程、测控技术与仪器、金属材料工程、功能材料、材料成型及控制工程、生物医学工程等专业，学生分流时专业任选。入校后可选拔进入机械日强班、材料中日精英班', 2024, 0, 0),
(7724435, '河北', '本科批', '物理', '化', '0399', '99', '大连理工大学', '19', '能源与动力工程', '(创新班)高保研率培养。该专业2024年与新加坡国立大学、德国斯图加特大学、亚琛工业大学等国外顶尖大学等有联合培养项目，与日本东京大学、东京理科大学、广岛大学等国外顶尖大学有修学分项目', 2024, 0, 0),
(7724436, '河北', '本科批', '物理', '化', '0399', '99', '大连理工大学', '20', '储能科学与工程', '(新工科拔尖班)高保研率培养。含储能科学与工程、过程装备与控制工程、化学工程与工艺、精细化工，本专业类内分流任选。不招色盲、色弱考生。化学工程等专业2024年与美国加州大学欧文分校、美国伊利诺伊大学芝加哥分校（UIC）有联合培养项目', 2024, 0, 0),
(7724437, '河北', '本科批', '物理', '化', '0399', '99', '大连理工大学', '21', '电子信息类', '含电子信息工程、计算机科学与技术、自动化、电气工程及其自动化、光电信息科学与工程、生物医学工程专业；本专业类内分流任选。入校后可选拔进入电子信息工程（英语强化）专业。计算机科学与技术入选教育部“101计划”。电子信息工程、计算机等专业2024年与美国加州大学欧文分校、英国布里斯托大学有联合培养项目', 2024, 0, 0),
(7724438, '河北', '本科批', '物理', '化', '0399', '99', '大连理工大学', '22', '电子信息类', '(创新班)含电子信息工程、计算机科学与技术、自动化、电气工程及其自动化、光电信息科学与工程、生物医学工程专业；高保研率培养。本专业类内分流任选。计算机科学与技术入选教育部“101计划”。电子信息工程、计算机等专业2024年与美国加州大学欧文分校、美国伊利诺伊大学芝加哥分校（UIC）、英国布里斯托大学有联合培养项目；光电信息科学与工程与新加坡国立大学有联合培养项目', 2024, 0, 0),
(7724439, '河北', '本科批', '物理', '化', '0399', '99', '大连理工大学', '23', '电子科学与技术', '含集成电路设计与集成系统、电子科学与技术，所在学院为全国首批国家示范性微电子学院，本专业与软件工程、网络工程同学域培养，专业分流在上述专业内任选。就读于大连开发区校区', 2024, 0, 0),
(7724440, '河北', '本科批', '物理', '化', '0399', '99', '大连理工大学', '24', '人工智能', '(未来技术班)智能+工程高保研率培养：低年级人工智能通识培养，高年级按学生意愿向人工智能、智能车辆、智能制造工程、精细化工、智能建造、生物工程专业分流；各专业均等设置保研名额，符合条件全员保研', 2024, 0, 0),
(7724441, '河北', '本科批', '物理', '化', '0399', '99', '大连理工大学', '25', '软件工程', '含软件工程、网络工程，学费前两年每人每年5200元，后两年每人每年16000元，就读大连开发区校区。本专业与电子科学与技术、集成电路与集成系统同学域培养，专业分流在上述专业内任选。软件工程等专业2024年与美国加州大学欧文分校、英国布里斯托大学有联合培养项目', 2024, 0, 0),
